import React from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
import { Card } from 'react-bootstrap';

function About() {
    return (
        <div className='container'>
            <h3 background-color='gray' text='white'>About</h3>
            <Card>
                <Card.Header as="h6">About</Card.Header>
                <Card.Body>
                    <Card.Text>
                        I have a strong working background in fast-paced environments and have worked in EdTech as a Code reviewer,
                        Operations, Sales, Marketing and Tutoring where I developed strong organisation, communication,
                        transferable and problem-solving skills.{<br />}

                        I recently graduated from a HyperionDev Software Engineering bootcamp and aspire to further master my skills
                        as well as learn new skills to build my career into a leadership role.{<br />}
                        
                        Currently seeking an opportunity to leverage my newly found skill set in a positive and advantageous
                        way whilst also gaining valuable experience and skills, I am also upskilling through Udemy courses to keep
                        up with the current market requirements.
                    </Card.Text>
                </Card.Body>
            </Card>
        </div>
    );
}

export default About;
